import Logo from '../../assets/minilogo.png'

const NavBar = () => {
    return(
        <div className="navbar">
            <div className="logoclass">
            <img src={Logo}/>
            <p>Picturest</p>
            </div>

        </div>
    );
};

export default NavBar;
